import React from "react";
import {Card, Divider,Button} from "semantic-ui-react";
import {GameDetails} from "../game-details/index.js";

export default function GameCard(){
    return(
        <Card key={this.props.id}>
        <Card.Content>
          <Card.Header textAlign="center">{this.props.title}</Card.Header>
          <Divider/>
              <Card.Meta>{this.props.localization}</Card.Meta>
          <Card.Description>

          </Card.Description>
        </Card.Content>
        <Card.Content extra>
          <div className='ui two buttons'>
            <Button basic color='green'>
              Approve
            </Button>
           <GameDetails 
            title={this.props.title}
            localization={this.props.localization.place}
            date={this.props.date}
            playerMax={this.props.palyer.max}  
            playerCur={this.props.palyer.current}  
            reqLvl={this.props.ReqLevelID}
            descript={this.props.Description}
           />
          </div>
        </Card.Content>
      </Card>
    )
}
